<head>
    <script>
        var accepted = ["-1035303014"];
        
        String.prototype.hash = function() {
            var hash = 0;
            if (this.length == 0) return hash;
            for (i = 0; i < this.length; i++) {
                char = this.charCodeAt(i);
                hash = ((hash << 5) - hash) + char;
                hash |= 0; //Convert to 32bit integer
            }
            return hash;
        }
    </script>
